import {
  Avatar,
  Box,
  Card,
  CardContent,
  Grid,
  Typography,
} from "@mui/material";
import Checkbox from "@mui/material/Checkbox";
import TextField from "@mui/material/TextField";
import TextareaAutosize from "@mui/base/TextareaAutosize";

export const CreateIntegration = (props) => (
  <CardContent>
    <Box
      component="form"
      sx={{
        '& .MuiTextField-root': { m: 1, width: '25ch' },
      }}
      noValidate
      autoComplete="off"
    >
    <TextField
      required
      id="outlined-required"
      label="Nome da integração"
      multiline
      maxRows={4}
    />
    <TextField
      required
      id="outlined-required"
      label="Descrição"
      multiline
      maxRows={4}
    />
    <TextField
      required
      id="outlined-required"
      label="Registradora"
      multiline
      maxRows={4}
    />
    <TextField
      required
      id="outlined-required"
      label="Produto"
      multiline
      maxRows={4}
    />

    </Box>
  </CardContent>
);
